import { InputGroup, FormControl } from "react-bootstrap"

function Home(){
    return(
        <div className="background">
            <div className="box">
                <h1 style={{color: "white"}}>Register</h1>
                <InputGroup style={{width: "80%"}}>
                    <FormControl placeholder="Username"/>
                </InputGroup>
            </div>

        </div>
    )
}

export default Home;
